import React from 'react';
import Mint from '../Mint';

import ListingForm from '../ListingForm';


function AssetSell() {
  return (
    <main>
        <div>
            <Mint />
        </div>
        <div>
            <ListingForm />
        </div>
    </main>
  );
}

export default AssetSell;
